요기요앱다운하고 족발은 몇번 시켜먹었었는데..닭발은 첨 시켜봤어요. 오오 생각보다 괜찮았어요 가격도 착하고 배달 시간도 30분정도로 무난했구요 무엇보다 무뼈닭발 닭비린맛도 않났고 적당히 매운맛으로 메모남겼는데 정말  적당히 매운맛이였구요 살짝 더 매운맛도 괜찮을뻔했어요귀찮아서 리뷰같은거 잘 않남기는데 맛이 너무 깔끔하니 좋네요~! 담번엔 좀 매운맛으로 시켜보려구요
별 한개 뺀건 같이온 부침개가 너무 형식적인 맛이라..;
가격이 착해서 그런걸수도 있지만 부침개가 밀가루밖에 없네요 부추는 달랑 열개정도구ㅋ 차라리 동치미로 대체하시던지요
